def cov(self, other=None, pairwise=None, ddof=1, **kwargs):
    if isinstance(self.window, BaseIndexer):
        validate_baseindexer_support('cov')
    if other is None:
        other = self._selected_obj
        pairwise = True if pairwise is None else pairwise
    other = self._shallow_copy(other)
    if self.is_freq_type:
        window = self.win_freq
    else:
        window = self._get_window(other)

    def _get_cov(X, Y):
        X = X.astype('float64')
        Y = Y.astype('float64')
        mean = lambda x: x.rolling(window, self.min_periods, center=self.center).mean(**kwargs)
        count = (X + Y).rolling(window=window, min_periods=0, center=self.center).count(**kwargs)
        bias_adj = count / (count - ddof)
        return (mean(X * Y) - mean(X) * mean(Y)) * bias_adj
    return _flex_binary_moment(self._selected_obj, other._selected_obj, _get_cov, pairwise=bool(pairwise))

def corr(self, other=None, pairwise=None, **kwargs):
    if isinstance(self.window, BaseIndexer):
        validate_baseindexer_support('corr')
    if other is None:
        other = self._selected_obj
        pairwise = True if pairwise is None else pairwise
    other = self._shallow_copy(other)
    window = self._get_window(other) if not self.is_freq_type else self.win_freq

    def _get_corr(a, b):
        a = a.rolling(window=window, min_periods=self.min_periods, center=self.center)
        b = b.rolling(window=window, min_periods=self.min_periods, center=self.center)
        return a.cov(b, **kwargs) / (a.std(**kwargs) * b.std(**kwargs))
    return _flex_binary_moment(self._selected_obj, other._selected_obj, _get_corr, pairwise=bool(pairwise))

