def cov(self, other=None, pairwise=None, ddof=1, **kwargs):
    if isinstance(self.window, BaseIndexer):
        validate_baseindexer_support("cov")

    if other is None:
        other = self._selected_obj
        # only default unset
        pairwise = True if pairwise is None else pairwise
    other = self._shallow_copy(other)

    # GH 16058: offset window
    if self.is_freq_type:
        window = self.win_freq
    else:
        window = self._get_window(other)

    def _get_cov(X, Y):
        # GH #12373 : rolling functions error on float32 data
        # to avoid potential overflow, cast the data to float64
        X = X.astype("float64")
        Y = Y.astype("float64")
        mean = lambda x: x.rolling(
            window, self.min_periods, center=self.center
        ).mean(**kwargs)
        count = (
            (X + Y)
            .rolling(window=window, min_periods=0, center=self.center)
            .count(**kwargs)
        )
        bias_adj = count / (count - ddof)
        return (mean(X * Y) - mean(X) * mean(Y)) * bias_adj

    return _flex_binary_moment(
        self._selected_obj, other._selected_obj, _get_cov, pairwise=bool(pairwise)
    )

def corr(self, other=None, pairwise=None, **kwargs):
    if isinstance(self.window, BaseIndexer):
        validate_baseindexer_support("corr")

    if other is None:
        other = self._selected_obj
        # only default unset
        pairwise = True if pairwise is None else pairwise
    other = self._shallow_copy(other)
    window = self._get_window(other) if not self.is_freq_type else self.win_freq

    def _get_corr(a, b):
        a = a.rolling(
            window=window, min_periods=self.min_periods, center=self.center
        )
        b = b.rolling(
            window=window, min_periods=self.min_periods, center=self.center
        )

        return a.cov(b, **kwargs) / (a.std(**kwargs) * b.std(**kwargs))

    return _flex_binary_moment(
        self._selected_obj, other._selected_obj, _get_corr, pairwise=bool(pairwise)
    )

@cache_readonly
def is_datetimelike(self) -> bool:
    return isinstance(
        self._on, (ABCDatetimeIndex, ABCTimedeltaIndex, ABCPeriodIndex)
    )

@cache_readonly
def _on(self) -> Index:
    if self.on is None:
        if self.axis == 0:
            return self.obj.index
        else:
            # i.e. self.axis == 1
            return self.obj.columns
    elif isinstance(self.on, Index):
        return self.on
    elif isinstance(self.obj, ABCDataFrame) and self.on in self.obj.columns:
        return Index(self.obj[self.on])
    else:
        raise ValueError(
            f"invalid on specified as {self.on}, "
            "must be a column (of DataFrame), an Index or None"
        )

def validate(self):
    super().validate()

    # we allow rolling on a datetimelike index
    if (self.obj.empty or self.is_datetimelike) and isinstance(
        self.window, (str, ABCDateOffset, timedelta)
    ):

        self._validate_monotonic()
        freq = self._validate_freq()

        # we don't allow center
        if self.center:
            raise NotImplementedError(
                "center is not implemented for "
                "datetimelike and offset based windows"
            )

        # this will raise ValueError on non-fixed freqs
        self.win_freq = self.window
        self.window = freq.nanos
        self.win_type = "freq"

        # min_periods must be an integer
        if self.min_periods is None:
            self.min_periods = 1

    elif isinstance(self.window, BaseIndexer):
        # Passed BaseIndexer subclass should handle all other rolling kwargs
        return
    elif not is_integer(self.window):
        raise ValueError("window must be an integer")
    elif self.window < 0:
        raise ValueError("window must be non-negative")

    if not self.is_datetimelike and self.closed is not None:
        raise ValueError(
            "closed only implemented for datetimelike and offset based windows"
        )

def _validate_monotonic(self):
    """
    Validate monotonic (increasing or decreasing).
    """
    if not (self._on.is_monotonic_increasing or self._on.is_monotonic_decreasing):
        formatted = self.on
        if self.on is None:
            formatted = "index"
        raise ValueError(f"{formatted} must be monotonic")

def _validate_freq(self):
    """
    Validate & return window frequency.
    """
    from pandas.tseries.frequencies import to_offset

    try:
        return to_offset(self.window)
    except (TypeError, ValueError) as err:
        raise ValueError(
            f"passed window {self.window} is not "
            "compatible with a datetimelike index"
        ) from err

